import blogger from "./blogger";
import TopBar from './TopBar/TopBar';
import './App.css';

export default function App(){

    return <div>
        <TopBar/>
        <h2>this is {blogger.name}</h2>
        <h2>Currently it is {blogger.time}</h2>
        <button onClick={Alert}></button>
    </div>
}

function Alert(){
    alert("you pressed a button!")
}
